    width: "150%",
    height: "450px",
    marginTop: "12%",
    marginLeft: "15%",
    borderRadius: "10px",
  },
  projects_h1: {
    fontSize: "32px",
    fontFamilly: "sans",
    fontWeight: "normal",
    forntStyle: "normal",
    textAlign: "left",
    paddingLeft: "3%",
    textTransform: "capitalize",
  },

  projects_p: {
